import React from 'react';


const myButton = () => this.props.isSubmitting ? (
    <button disabled className="btn btn-info">
      submitting...
    </button>
  ) : (
    <button
      disabled={!this.state.isValidForm}
      type="submit"
      className="btn btn-info"
    >
      submit
    </button>
  );

  export default myButton;
